- BindingMixture.analyzeWindow() - Inside the else condition:
I have commented some lines which were representing my old way of determining resolution between components. I was fixed and produced far too many components.

- BindingMixture.analyzeWindow():
I have added a new way of evaluating the components of a region.
Shortly this is:
i) Initialize spacing between components through the initSpacing() method based on width of the region under examination.
ii) Find the components of this region
iii) Update the components based on the number of non-zero components that were found in the current update and the *window* around a component.
The *window* around a component is dependent on the maximum number of updates for this region plus the range of the model distribution. See method updateComps() for details.
iv) Check for convergence between updates.
I.e. if the log-likelihood of the data are below some threshold based on the components between two successive updates or if the component locations between successive updates coincide, we converge.

