- BindingMixture.setMultiIndepMixtureParams():
Created this method to set the parameter of the MultiConditionMixture model. Also, I changed the maximum number of annealing iterations from 120 -> 200.

- BindingMixture.determineNonZeroComps():
Added this method which generates the component structures (based in the EM predictions)

- BindingMixture.checkCompExactMatching():
Method that checks for exact matching between two sets of components.

- BindingMixture.initSpacing():
Added this method which initializes spacing between components.

- BindingMixture.updateComps():
Added this method which updates the components based on the positions of the previous non zero components and the defined window around a component.
